    getSomeItem = () => {
        axios
            .get('/products')
            .then(({ data }) => {
                console.log(data);
            })
            .catch((e) => {
                console.error(e);
            });
    };
    componentDidMount () {
        const script = document.createElement("script");
        script.async = true;
        script.src =
          "https://dapi.kakao.com/v2/maps/sdk.js?appkey=7b9f7a195892ef8871b1f77b7d995f3d&autoload=false";
        document.head.appendChild(script);

        script.onload = () => {
          kakao.maps.load(() => {
            let container = document.getElementById("Mymap");
            let options = {
              center: new kakao.maps.LatLng(37.506502, 127.053617),
              level: 7
            };

            const map = new window.kakao.maps.Map(container, options);

          });
        };
      }
